  return (
    <div>
      <h1>2023-2024 SAISON STATS</h1>
      <table>
        <thead>
          <tr>
            <th>CLASSEMENT</th>
            <th>JOUEUR</th>
            <th>ÉQUIPE</th>
            <th>M</th>
            <th>MJ</th>
            <th>PPM</th>
            <th>RPM</th>
            <th>PDPM</th>
            <th>MPM</th>
            <th>EFF</th>
            <th>FG%</th>
            <th>3P%</th>
            <th>%LF</th>
            <th>DÉSACTIVÉ</th>
            <th>DÉF</th>
            <th>IPM</th>
            <th>CPM</th>
            <th>BP</th>
            <th>FP</th>
          </tr>
        </thead>
        <tbody>
          {/* {seasonStats.map((playerStat, index) => (
            <PlayerStatsRow key={index} {...playerStat} />
          ))} */}
          <tr>
            <td>hum CLASSEMENT</td>
            <td>hum JOUEUR</td>
            <td>hum ÉQUIPE</td>
            <td>hum M</td>
            <td>hum MJ</td>
            <td>hum PPM</td>
            <td>hum RPM</td>
            <td>hum PDPM</td>
            <td>hum MPM</td>
            <td>hum EFF</td>
            <td>hum FG%</td>
            <td>hum 3P%</td>
            <td>hum %LF</td>
            <td>hum DÉSACTIVÉ</td>
            <td>hum DÉF</td>
            <td>hum IPM</td>
            <td>hum CPM</td>
            <td>hum BP</td>
            <td>hum FP</td>
            </tr>
        </tbody>
      </table>
    </div>
  );
};

